import React from 'react';
//import './App.css';
import { Link } from 'react-router-dom';
import store from './store';



export const MainContainer = () => {
    return (
        <div className='FolderandNoteList'>
            <ul className='FolderList'>
                {store.folders.map(folders => 
                    <li key={folders.id}>
                        <Link to={`/folders/${folders.id}`}>
                            {folders.name}
                        </Link>
                    </li>
                )}
            </ul>


            <ul className='NoteList'>
                {store.notes.filter(notes => 
                    notes.folderId === store.folders.map(filteredNotes => (
                        <li key={notes.id}>
                            {filteredNotes}
                        </li>
                    ))
                )}
            </ul>
        </div>

    )
}
